import React from "react";
import '../contact/Contact.css'

const Contact = () => {
  return (
    // <div>Contact</div>
    <div className="conatct_us">
      <div className="left">
        Contact Us
      </div>
      <div className="right">
        <p>Login form</p>
      </div>
    </div>
  )
}

export default Contact
